import React, { useState } from "react";
import { FaDownload, FaSearch, FaExclamationTriangle, FaInfoCircle } from "react-icons/fa";
import "./AlertsReports.css"; // Import the corresponding CSS

const AlertsReports = () => {
  const [searchTerm, setSearchTerm] = useState("");
  const [filter, setFilter] = useState("All");

  const alerts = [
    { id: 1, type: "Critical", message: "Cyber attack detected", date: "2025-03-29" },
    { id: 2, type: "Moderate", message: "Unusual login attempt", date: "2025-03-28" },
    { id: 3, type: "Info", message: "System update completed", date: "2025-03-27" },
    { id: 4, type: "Critical", message: "Data breach suspected", date: "2025-03-26" },
    { id: 5, type: "Moderate", message: "Potential phishing email detected", date: "2025-03-25" },
  ];

  const filteredAlerts = alerts.filter(alert =>
    (filter === "All" || alert.type === filter) &&
    alert.message.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="alerts-reports-container">
      <h1 className="title">⚠️ Alerts & Reports</h1>
      
      {/* Search & Filter Controls */}
      <div className="controls">
        <div className="search-container">
          <FaSearch className="search-icon" />
          <input
            type="text"
            placeholder="Search alerts..."
            className="search-bar"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </div>

        <select
          className="filter-dropdown"
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
        >
          <option value="All">All Alerts</option>
          <option value="Critical">Critical</option>
          <option value="Moderate">Moderate</option>
          <option value="Info">Informational</option>
        </select>
      </div>

      {/* Alerts Table */}
      <table className="alerts-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Type</th>
            <th>Message</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {filteredAlerts.length > 0 ? (
            filteredAlerts.map((alert) => (
              <tr key={alert.id} className={alert.type.toLowerCase()}>
                <td>{alert.id}</td>
                <td>
                  {alert.type === "Critical" && <FaExclamationTriangle className="critical-icon" />}
                  {alert.type === "Moderate" && <FaExclamationTriangle className="moderate-icon" />}
                  {alert.type === "Info" && <FaInfoCircle className="info-icon" />}
                  {alert.type}
                </td>
                <td>{alert.message}</td>
                <td>{alert.date}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="4" className="no-alerts">No alerts found.</td>
            </tr>
          )}
        </tbody>
      </table>

      {/* Download Button */}
      <button className="download-btn">
        <FaDownload /> Download Reports
      </button>
    </div>
  );
};

export default AlertsReports;
